import React, { Component } from 'react';


class User extends Component {

render() {
    return (
        <div className="card-body">
        <ul>
            <li className="tableToggleRow">Profile</li>
            <li className="tableToggleCard">LogOut</li>
        </ul>
        </div>
    );
  }
}

export default User ;
